import React, { Component } from 'react';

class Search extends Component {

  componentDidMount(){
    fetch('https://data.cityofnewyork.us/resource/4kpn-sezh.json')
    .then(r => r.json())
    .then(data => {
      console.log(data)
    })
  }

  render() {
    return (
      <div id="search-input">
      <input
          id="search-input"
          autoComplete="off"
          type="text"
          placeholder='Search by Location...'
          />
      </div>
    );
  }

}

export default Search;
